import React, { Component } from 'react';
import "./NavBar.css"

export default class NavBar extends Component {
    constructor(props) {
        super(props);
        this.state = {date: new Date()};
    }

    componentDidMount() {
        this.timerID = setInterval(
            () => this.tick(),
            1000
          );      
    }

    componentWillUnmount() {
        clearInterval(this.timerID);
    }

    tick() {
        this.setState({
            date: new Date()
        });
    }

    render() {
        return (
            <div class='NavBar'>
                <div class='row'>
                    <div class='blue-column'>
                        <div class='column'>
                            ABOUT
                        </div>
                    </div>
                    <div class='column'>
                        <div class='column'>
                            WORK
                        </div>
                    </div>
                    <div class='column'>
                        <div class='column'>
                            BLOG
                        </div>
                    </div>
                    <div class='column'>
                        <div class='column'>
                            CONTACT
                        </div>
                    </div>
                </div>
            </div>
        );
    }
}
